import React from 'react';
import style from './DateInput.module.less';

export default function DateInput({ className, ...props }) {
  return (
    <div className={style.DateInput}>
      <input
        className={
          className
            ? `${style.DateInput__input} ${className}`
            : style.DateInput__input
        }
        type='datetime-local'
        {...props}
      />
    </div>
  );
}
